import React, { Component } from "react";
class UnconfirmedModalBody extends Component {
  state = {
    client: this.props.client,
    editPhone: this.props.client.telefono,
    editEmail: this.props.client.email,
  };

  handleChange = (input, isCheckbox) => {
    const client = { ...this.state.client };
    console.log(input.name);
    if (isCheckbox) {
      client[input.name] = input.checked;
    } else {
      client[input.name] = input.value;
    }
    console.log(client);
    this.setState({ client });
  };

  render() {
    console.log(this.state.client);
    return (
      <form action={this.handleSubmit}>
        <div className="container-fluid">
          <h5>NAG</h5>
          <p>{this.state.client.nag}</p>
          <h5>Nome di battesimo</h5>
          <p> {this.state.client.nome}</p>
          <h5>Data di nascita</h5>
          <p> {this.state.client.dataNascita}</p>

          <div className="form-check form-check-wrapper">
            <input
              className="form-check-input "
              type="text"
              value={this.state.editPhone}
              id="telefono"
              name="numeroDiTelefono"
              onChange={(e) => {
                this.handleChange(e.currentTarget);
              }}
            />
            <label className="form-check-label" htmlFor="telefono">
              <h5>Numero di telefono</h5>
              {this.state.client.telefono}
            </label>
          </div>
          <br />
          <div className="form-check form-check-wrapper">
            <input
              className="form-check-input"
              type="email"
              value={this.state.editEmail}
              id="email"
              name="email"
              onChange={(e) => {
                this.handleChange(e.currentTarget);
              }}
            />

            <label className="form-check-label" htmlFor="email">
              <h5>Email</h5>
              {this.state.client.email}
            </label>
          </div>
          <br />
          <h5>Privacy</h5>
          {[1, 2, 3, 4, 5, 6, 7].map((privacyNumber) => {
            return (
              <div
                key={privacyNumber}
                className="form-check form-check-wrapper"
              >
                <input
                  className="form-check-input"
                  type="checkbox"
                  id={`id-${privacyNumber}`}
                  name={`p${privacyNumber}`}
                  checked={
                    this.state.client[`p${privacyNumber}`] ? "checked" : ""
                  }
                  onChange={(e) => {
                    this.handleChange(e.currentTarget, true);
                  }}
                />
                <label className="form-check-label" htmlFor="p1">
                  Privacy {privacyNumber}
                </label>
              </div>
            );
          })}
          <br />
        </div>
      </form>
    );
  }
}

export default UnconfirmedModalBody;
